  const [myTimer, SetMyTimer] = useState(0)
  const [myTimerEvent, SetMyTimerEvent] = useState(0)

  const [continueMinutes, SetContinueMinutes] = useState(true)




  useEffect(() => {
    if (matchStartValueBool == true && matchMinutesValue < 90 && matchMinutesValue != 90 && continueMinutes == true) {

      clearTimeout(myTimer)
      SetMyTimer(setTimeout(() => dispatch(GetMatchMinutesValue_Plus()), waitForTimeMinutes))
      ReturnEnergys()
      ReturnSpiker()

    } else if (matchStartValueBool == true && matchMinutesValue < 90 && matchMinutesValue != 90) {

      clearTimeout(myTimer)
      SetMyTimer(setTimeout(() => dispatch(GetMatchMinutesValue_Plus()), waitForTimeMinutes))
      ReturnEnergys()
      ReturnSpiker()

    }
  }, [matchMinutesValue, IsTacticsButtonClickValue])










  useEffect(() => {
    if (continueMinutes == false) {

      SetContinueMinutes(true)
      clearTimeout(myTimer)
      SetMyTimer(setTimeout(() => {

        if (matchStartValueBool == true && matchMinutesValue != 90 && matchMinutesValue < 90) {
          dispatch(GetMatchMinutesValue_Plus())
        }

      }, waitForTimeEvents))

    }
  }, [continueMinutes])


  useEffect(() => {
    if (matchMinutesValue == 45) {
      SetSpiker(spiker_halfOver)
    }

    if (matchMinutesValue == 90) {
      if (homeTeamScoreValue > awayTeamScoreValue) {
        SetSpiker(homeTeamName + spiker_matchEnd1)
      } else if (homeTeamScoreValue < awayTeamScoreValue) {
        SetSpiker(awayTeamName + spiker_matchEnd1)
      } else if (homeTeamScoreValue > awayTeamScoreValue) {
        SetSpiker(spiker_matchEnd2)
      }
    }
  }, [matchMinutesValue])








  useEffect(() => {

    SetContinueMinutes(false)

  }, [spiker])





